ee\";s:57:\"6点~7点：血压开始升高，心跳也逐渐加快。\";s:24:\"htm_lang_healthtip7_7ree\";s:57:\"7点~8点：体温开始上升，人体免疫力最强。\";s:24:\"htm_lang_healthtip8_7ree\";s:69:\"8点~9点：皮肤有毒物质排除殆尽，性激素含量最高。\";s:24:\"htm_lang_healthtip9_7ree\";s:70:\"9点~10点：皮肤痛觉降低。此时是就医注射的好时机。\";s:25:\"htm_lang_healthtip10_7ree\";s:47:\"10点~11点：精力充沛，最适宜工作。\";s:25:\"htm_lang_healthtip11_7ree\";s:59:\"11点~12点：精力最旺盛，人体不易感觉疲劳。\";s:25:\"htm_lang_healthtip12_7ree\";s:68:\"12点~13点：经历了一个上午的工作，人体需要休息。\";s:25:\"htm_lang_healthtip13_7ree\";s:113:\"13点~14点：胃液分泌最多，胃肠加紧工作，适宜进餐，稍感疲乏，需要短时间的休息。\";s:25:\"htm_lang_healthtip14_7ree\";s:62:\"14点~15点：人体应激能力下降，全身反应迟钝。\";s:25:\"htm_lang_healthtip15_7ree\";s:56:\"15点~16点：体温最高，工作能力开始恢复。\";s:25:\"htm_lang_healthtip16_7ree\";s:44:\"16点~17点：血糖升高，脸部最红。\";s:25:\"htm_lang_healthtip17_7ree\";s:92:\"17点~18点：工作效率最高，肺部呼吸运动最活跃，适宜进行体育锻炼。\";s:25:\"htm_lang_healthtip18_7ree\";s:41:\"18点~19点：人体痛觉再度降低。\";s:25:\"htm_lang_healthtip19_7ree\";s:71:\"19点~20点：血压略有升高。此时，人们情绪最不稳定。\";s:25:\"htm_lang_healthtip20_7ree\";s:59:\"20点~21点：记忆力最强，大脑反应异常迅速。\";s:25:\"htm_lang_healthtip21_7ree\";s:62:\"21点~22点：脑神经反应活跃，适宜学习和记忆。\";s:25:\"htm_lang_healthtip22_7ree\";s:56:\"22点~23点：呼吸开始减慢，体温逐渐下降。\";s:25:\"htm_lang_healthtip23_7ree\";s:77:\"23点~24点：机体功能处于休息状态，一天的疲劳开始缓解。\";s:20:\"htm_lang_newbie_7ree\";s:9:\"新同学\";}s:13:\"chs_tiebalist\";a:8:{s:6:\"forums\";s:6:\"版块\";s:7:\"recover\";s:6:\"覆盖\";s:9:\"timerange\";s:12:\"时间范围\";s:6:\"submit\";s:6:\"提交\";s:19:\"beginingcreatethumb\";s:21:\"开始创建缩略图\";s:6:\"finish\";s:9:\"已完成\";s:9:\"completed\";s:12:\"创建结束\";s:6:\"return\";s:6:\"返回\";}s:12:\"dxksst_floor\";a:6:{s:10:\"first_page\";s:6:\"首页\";s:8:\"end_page\";s:6:\"尾页\";s:12:\"collect_info\";s:63:\"点击确定将会采集论坛默认的回复数据到楼中楼\";s:14:\"collect_notice\";s:98:\"注意:被采集的默认的回复数据将会被隐藏,卸载本插件后会恢复到显示状态\";s:7:\"confirm\";s:6:\"确定\";s:6:\"cancel\";s:6:\"取消\";}s:8:\"k_misign\";a:31:{s:5:\"index\";s:6:\"首页\";s:4:\"sign\";s:6:\"签到\";s:6:\"signed\";s:9:\"已签到\";s:3:\"row\";s:6:\"连续\";s:4:\"days\";s:3:\"天\";s:6:\"people\";s:3:\"人\";s:14:\"signtoranklist\";s:15:\"签到看排